import React from "react";

const LogEntryForm = () => {
  const [commentInput, setCommentInput] = useState("");

  return (
    <form>
      <label>Title</label>
      <input
        type="text"
        placeholder="enter something here"
        value={commentInput}
        onChange={(e) => setCommentInput(e.target.value)}
      ></input>
    </form>
  );
};

export default LogEntryForm;
